text:
Un déchaumeur ou une déchaumeuse est un outil agricole conçu pour le déchaumage mais il a aussi d'autres objectifs :effectuer simultanément un travail du sol superficiel par pulvérisation pour préparer le semis ;
casser une éventuelle croûte de battance ;
détruire les adventices ;.

